column8:
スペック染料について<br>
染料を水に不溶のカプセルで包み込んだ粒状とし、そのカプセルが水に浮遊した状態の染液を一カセづつ糸の表面に付着させる染め方です。<br>
染料粒子の多い所は色が濃く、少ない所は薄く見える一種のムラ染めといえるものです。<br>
すべて染まり方が違い、普通のソリッドの染めとは違うナチュラルな味のある優しい色合いが表現できます。<br><br>

適度な張りがあって丈夫な生地です。<br>
ワンピース、パンツ、スカートなどのお洋服から、バッグやクッションなどのインテリア雑貨まで幅広くお使いいただけます♪<br><br>

★表示価格は10cm単位（税込）です。<br>
50cm以上10cm単位でご注文ください。<br>
・入力例：60cm　→　6 、120cm　→　12<br><br>

・素材：綿80％、麻20％<br>
・サイズ：幅110cm<br><br>

※お客様のご注文数によりカットされた生地は再販売不能となりますので、不良品、商品違い以外のお客様都合での返品はお受けできません。あらかじめご了承の上、ご注文ください。<br>
